  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})

export class HeaderComponent {

  constructor(public _dialog: MatDialog) {}

  ngOnInit(): void {}

  isAuthenticated: boolean = false;

  openEventCreateForm() {
    this._dialog.open(EventCreateComponent)
  }


